import React from 'react';
import { Link } from 'react-router-dom';

const Room = () => {
  return (
    <div className="container flex flex-col items-start justify-start h-screen px-9 py-12">
      <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-10 px-16 rounded flex items-center">
        <span className="mr-2 text-4xl">+</span>
        Add Room
      </button>
    </div>
  );
};

export default Room;
